import React from 'react';
function CreateTicketSection() {
    return (
        <div className='container'>
            <div className='row p-5'>
                <div className='col-8 input-group input-group-lg'>                        
                    <span class="input-group-text" id="inputGroup-sizing-default">Large</span>
                    <select class="form-select"  aria-describedby="inputGroup-sizing-lg">
                        <option selected>Open this select menu</option>
                        <option >One</option>
                        <option >Two</option>
                        <option >Three</option>
                    </select>
                    </div>
                <div className='col-4'></div>
            </div>
        </div>
    );
}

export default CreateTicketSection;
